INSERT INTO `u_webpages` VALUES (37,'Evangelische Stichting Jongerenhuisvesting Rotterdam','<h1>Welkom</h1>\n<p><strong>Studeren in Rotterdam? Kom dan wonen in het jongerenhuis van de ESJR!</strong></p>\n<h3>Aankomend student<strong><br /></strong></h3>\n<p>Ga je studeren in Rotterdam? Woon je te ver weg om elke dag heen en weer te reizen? En neem jij het woord van God aan als richtlijn voor je leven?<br /><br />Dan kun je je <a href=\"/Komen-wonen/\">aanmelden</a> om de eerste twee jaar van je studie te komen wonen in het jongerenhuis aan de Vierambachtsstraat in Rotterdam.</p>\n<p><em>Let op: er zijn helaas geen kamers meer beschikbaar voor het studiejaar 2018-2019.</em></p>\n<p><em>De aanmeldingen voor het studiejaar 2019-2020 zijn open. Na het invullen van het formulier zal er rond april 2019 contact worden opgenomen.&nbsp;</em></p>'),(1145,'Wie zijn wij?','<h1>Wie zijn wij?</h1>\n<h2>Het huis</h2>\n<p>Het ESJR-huis is in 1983 gestart door een aantal enthousiaste gemeenteleden uit de Nederlands Gereformeerde Kerk van Overschie en biedt jongeren met een positief christelijke instelling voor twee jaar woonruimte om te kunnen wennen aan de stad, de studie en het op kamers wonen. In deze tijd is er ruimte om met mede christenen en ervare studenten, of via een kerkelijke gemeente en verschillende (christelijke) studentenverenigingen een thuisplek te vinden in de stad. Ieder jaar verhuist de helft van de bewoners en wordt er weer plaats gemaakt voor nieuwe studenten. Op deze manier is er altijd een groep waar nieuwe bewoners zich bij aan kunnen sluiten. Door de vriendschappen die worden opgebouwd vinden de bewoners vaak met elkaar ook weer nieuwe woonruimte.&nbsp; Het huis is ondergebracht in de stichting ESJR (Evangelische Stichting Jongerenhuisvesting Rotterdam).</p>\n<h2>Het bestuur</h2>\n<p>De bestuursleden komen uit de samenwerkende gemeentes van Nederlands en Christelijk Gereformeerd Rotterdam-Centrum en Overschie. Zij komen om de 8 weken bij elkaar om het reilen en zeilen in het huis te bespreken en eventuele calamiteiten en onderhoudswerkzaamheden te sturen. De bestuursleden doen dit op geheel vrijwillige basis, zij wonen niet zelf in het huis.</p>\n<h2>De kamers</h2>\n<p>Het huis telt 4 verdiepingen met in totaal 9 kamers en 2 logeerkamers. De kamers zijn centraal verwarmd en ongemeubileerd. Er zijn drie keukens, drie badkamers en er is <span>een telefoonaansluitingen voor administratief gebruik</span><span>.</span> Ook heeft elke kamer beschikking over een ADSL-verbinding.&nbsp; De huurprijzen zijn afhankelijk van de grootte van de kamer en liggen onder het gemiddelde van een studentenkamer in Rotterdam. Verwacht echter geen grote luxe of een overdaad aan comfort.<br /> In principe woont iedereen zelfstandig. Het huis biedt echter volop mogelijkheden om samen activiteiten te ondernemen. Het gezamenlijk eten is daar een goed voorbeeld van. Er wordt hierbij wel een actieve houding van de bewoners verwacht.<span style=\"text-decoration: underline;\"></span></p>\n<p>Er zijn twee \'hoofdbewoners\' in het huis die grote en kleine dingen regelen die nodig zijn om het huis leefbaar te houden en zij zijn aanspreekpunt voor de bewoners. Zij houden contact met het bestuur over de gang van zaken in en om het huis.</p>\n<h2>De straat</h2>\n<p>Het Jongerenhuis is een pand gebouwd rond 1920 en staat aan de Vierambachtsstraat, een winkelstraat midden in de veelkleurige wijk Het Nieuwe Westen. Deze wijk is multicultureel en biedt allerlei exotische winkels. Hier wonen de bewoners van het huis al 35 jaar rustig tussen. Op de fiets ben je binnen 10 minuten in het centrum van de stad. Openbaar vervoer stopt nagenoeg voor de deur.</p>'),(1146,'Komen wonen','<h1>Komen wonen</h1>\n<h2>De aanmelding <span class=\"small\" style=\"font-weight: normal;\">(Geen kamers meer vrij voor het studiejaar 2018-2019)</span></h2>\n<p>Trekt het je aan om in het&nbsp;ESJR-huis&nbsp;te komen wonen? Vul dan het&nbsp;<a href=\"http://www.esjr.nl/data/world/files/ESJR%20aanmdeldingsformulier.pdf\">aanmeldingsformulier</a>&nbsp;&nbsp;volledig in en mail het of stuur het op over de post. Het liefst ontvangen we je aanmelding v&oacute;&oacute;r 1 juli, maar ook daarna zijn aanmeldingen eventueel nog welkom. Het is echter niet per se zo dat \'wie het eerst komt, het eerst maalt\'; toewijzing van een kamer gebeurt op grond van duidelijke selectiecriteria. Na ontvangst van je aanmeldingsformulier sturen wij&nbsp; je een bevestigingsmail en wordt er zo spoedig mogelijk contact met je opgenomen.</p>\n<h3>Toelatingscriteria</h3>\n<p>Het bestuur van ESJR maakt in overleg met de hoofdbewoners uit de aanmeldingen een voorselectie op basis van de volgende criteria:</p>\n<ul class=\"unIndentedList\">\n<li> Ben je christen</li>\n<li>Hoe ver je op dit moment buiten Rotterdam woont</li>\n<li>Je ervaring met het op kamers wonen</li>\n<li>Je leeftijd</li>\n<li>Jou motivatie om in het huis te komen wonen</li>\n</ul>\n<p>Ook kijkt de stichting naar de kerkelijke achtergrond en het geslacht van degenen die zich aanmelden, om een gevarieerde bewonersgroep te krijgen.</p>\n<p>Vervolgens wordt iedereen die op basis van de toelatingscriteria in aanmerking komen voor een kamer uitgenodigd voor een gesprek. Degenen die niet in aanmerking worden hiervan zo spoedig mogelijk op de hoogte gesteld.</p>\n<p><a href=\"http://www.esjr.nl/data/world/files/ESJR%20aanmdeldingsformulier.pdf\">Download hier het aanmeldingsformulier</a>.&nbsp;</p>\n<p>Of vul het formulier in via deze <a href=\"https://docs.google.com/forms/d/1V73SzXdQIS5a8M2E8OHQTLsvUCsrZw_V9DhruLzazsE/viewform?usp=send_form\">link</a>.</p>\n<h2>Gesprek</h2>\n<p>Voordat we een kamer verhuren willen we graag eerst wat uitgebreider kennis maken. In een ontspannen sfeer kun jij iets over jezelf vertellenen wij iets over het huis. Je krijgt een rondleiding door het huis en je kan hierna een eventuele voorkeur voor een kamer uitspreken. Afhankelijk van dit gesprek wordt al dan niet een kamer toegewezen. Daarbij wordt zoveel mogelijk rekening gehouden met je voorkeur. Bij gelijke voorkeur voor een kamer wordt wel naar de datum van aanmelding gekeken. Er zijn in principe per jaar drie tot vier kamers te verdelen; mensen die we&nbsp;teleur moeten stellen worden hier uiteraard zo spoedig mogelijk van op de hoogte gesteld.</p>\n<h2>Verhuizen</h2>\n<p>Wanneer je een kamer wordt toegewezen kun je met de hoofdbewoners afspraken maken over de verhuizing enzovoorts. In principe kun je jezelf dan vanaf 1 augustus Rotterdammer noemen!</p>\n<p>&nbsp;</p>'),(1147,'Contact','<h1>Contact</h1>\n<p><a href=\"Javascript:location.href=\'ma\'+\'il\'+\'to\'+\':i\'+\'nf\'+\'o@\'+\'es\'+\'jr\'+\'.n\'+\'l\'\"></a><a href=\"Javascript:location.href=\'ma\'+\'il\'+\'to\'+\':E\'+\'SJ\'+\'Rh\'+\'ui\'+\'s@\'+\'gm\'+\'ai\'+\'l.\'+\'co\'+\'m\'\">ESJRhuis@gmail.com</a></p>\n<h2>Huisadres</h2>\n<p>Vierambachtsstraat 20<br />3023 AM&nbsp; Rotterdam</p>\n<p><a href=\"http://maps.google.nl/maps?oe=utf-8&amp;client=firefox-a&amp;ie=UTF8&amp;q=Vierambachtsstraat+20+3023+AM++Rotterdam&amp;fb=1&amp;split=1&amp;gl=nl&amp;cid=0,0,15737972382421034089&amp;ei=rwbaSc-SOcbF-QbVsPTJBQ&amp;t=h&amp;z=16&amp;iwloc=A\">Google Map &gt;</a></p>\n<h2>Routebeschrijving</h2>\n<h3>Openbaar vervoer</h3>\n<ul>\n<li>NS-station Rotterdam Centraal;</li>\n<li>Tramlijn 21 (richting Woudhoek) of</li>\n<li>Tramlijn 23 (richting Marconiplein) of</li>\n<li>Tramlijn 24 (richting Holy);&nbsp;</li>\n<li>Uitstappen Halte Vierambachtsstraat</li>\n</ul>\n<h3>Eigen Vervoer</h3>\n<ul>\n<li>A20 afslag Overschie/Blijdorp (afrit 13)</li>\n<li>Neem richting Blijdorp.</li>\n<li>Bij het tweede verkeerslicht rechts (op de hoek aan de overkant staat een kerk), langs diergaarde Blijdorp rijden, richting Centrum. </li>\n<li>Onder spoorwegviaduct door, bij verkeerslicht rechtdoor (Heemraadsingel), eerstvolgende kruising rechts is Vierambachtsstraat.</li>\n</ul>');
